import React from 'react';
// const Hammer = require('react-hammerjs')//v1.0.1 ????
import Hammer from 'react-hammerjs'
import logo from './logo.svg';
// import './Touch';
import './App.css';
//

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Hammer onTap={console.log("TAPTAP")}>
        <img src={logo} className="App-logo" alt="logo" />
      </Hammer>
      </header>
    </div>
  );
}

export default App;
